import React from "react";
import style from "./style.module.css";
import logo from "../../images/logo.svg";
export const Header = () => {
  return (
    <header className={style.header}>
      <div className={style.logo}>
        <img src={logo} alt="logo" />
      </div>
      <div className={style.catolog}>
        C
      </div>
    </header>
  );
};
